import React, { useEffect } from 'react'
import { useState } from 'react'
import axios from 'axios'

export default function Home() {
  const [data, setData] = useState([]);
  // useEffect(() => {
  //   axios.get(' https://newsapi.org/v2/top-headlines?country=in&category=general&apiKey=c74970e40cf34fdba2a15eb9c954fa69')
  //     .then((res) => {
  //       setData(res.data.articles);
  //     });
  // })

  const categoryChangeToI = () => {
    axios.get('https://newsapi.org/v2/top-headlines?country=in&apiKey=c74970e40cf34fdba2a15eb9c954fa69')
      .then((res) => {
        setData(res.data.articles);
      });
  }
  const categoryChangeToU = () => {
    axios.get('https://newsapi.org/v2/top-headlines?country=us&apiKey=c74970e40cf34fdba2a15eb9c954fa69')
      .then((res) => {
        setData(res.data.articles);
      });
  }
  const categoryChangeToC = () => {
    axios.get('https://newsapi.org/v2/top-headlines?country=ca&apiKey=c74970e40cf34fdba2a15eb9c954fa69')
      .then((res) => {
        setData(res.data.articles);
      });
  }

  const categoryChangeToG = () => {
    axios.get('https://newsapi.org/v2/top-headlines?country=in&category=general&apiKey=c74970e40cf34fdba2a15eb9c954fa69')
      .then((res) => {
        setData(res.data.articles);
      });
  }
  const categoryChangeToSp = () => {
    axios.get('https://newsapi.org/v2/top-headlines?country=in&category=sports&apiKey=c74970e40cf34fdba2a15eb9c954fa69')
      .then((res) => {
        setData(res.data.articles);
      });
  }

  const categoryChangeToS = () => {
    axios.get('https://newsapi.org/v2/top-headlines?country=in&category=science&apiKey=c74970e40cf34fdba2a15eb9c954fa69')
      .then((res) => {
        setData(res.data.articles);
      });
  }
  const categoryChangeToE = () => {
    axios.get('https://newsapi.org/v2/top-headlines?country=in&category=entertainment&apiKey=c74970e40cf34fdba2a15eb9c954fa69')
      .then((res) => {
        setData(res.data.articles);
      });
  }

  const categoryChangeToT = () => {
    axios.get('https://newsapi.org/v2/top-headlines?country=in&category=technology&apiKey=c74970e40cf34fdba2a15eb9c954fa69')
      .then((res) => {
        setData(res.data.articles);
      });
  }

  const categoryChangeToB = () => {
    axios.get('https://newsapi.org/v2/top-headlines?country=in&category=business&apiKey=c74970e40cf34fdba2a15eb9c954fa69')
      .then((res) => {
        setData(res.data.articles);
      });
  }


  const news = data.map((value, index) => {
    return (
      <div key={index} className="card">
        <img src={value.urlToImage} alt="..." />
        <div className='card-body'>
          <h4 className='title'>{value.title}</h4>
          <p className='description'>{value.description}</p>
          <a href={value.url} className="btn">READ MORE</a>
        </div>
      </div>
    )
  })

  const heading = data.map((value,index) => {
    return(
      <div>
        {value}
      </div>
    )
  })

  return (
    <div>

      <div className='mainbox'>
        <div className='sidebox'>
          <div className='category'>
            <h2>Category</h2>
            <button onClick={categoryChangeToG}>General</button>
            <br />
            <button onClick={categoryChangeToSp}>Sports</button>
            <br />
            <button onClick={categoryChangeToS}>Science</button>
            <br />
            <button onClick={categoryChangeToE}>Entertainment</button>
            <br />
            <button onClick={categoryChangeToT}>Technology</button>
            <br />
            <button onClick={categoryChangeToB}>Business</button>
          </div>
          <div>
            <h2>Country</h2>
            <button onClick={categoryChangeToI}>India</button><br />
            <button onClick={categoryChangeToU}>USA</button><br />
            <button onClick={categoryChangeToC}>Canada</button>
          </div>
        </div>
        <div className='centerbox'>
          <div className='heading'>

          </div>
          {heading}
            {news}
        </div>
      </div>

    </div>

  )


}
